              img: `<svg width="120" height="40" viewBox="0 0 120 40" xmlns="http://www.w3.org/2000/svg"><text x="60" y="28" text-anchor="middle" font-size="21" fill="#333" font-family="Arial, sans-serif">huge 巨大</text></svg>`,
